import useAxios from "../utils/useAxios";

let user_id = 0
let username = ''

const load_var = async () => {
    const api = useAxios

    const id = api.get("/userID/");
    user_id = id.data.response

    const un = api.get("/username/");
    username = un.data.response
}
load_var()  

  


  export {user_id, username};
